import React from 'react';

class TopBands extends React.Component {

  render() {
    return (
      <div>
        <h2 className="ui header">Top Bands</h2>
        <div className="ui four column grid">
          <div className="row">
            <div className="column">band1</div>
            <div className="column">band2</div>
            <div className="column">band3</div>
            <div className="column">band4</div>
          </div>
        </div>
      </div>
    );
  }

}

export default TopBands;
